import React from 'react';

import Header from '../components/Header';

import { Container } from './index-styles';

export default function Home() {
  return ( 
    <>
      <Header page="inicio" />
      <Container>
        <img  
          src="/assets/images/hero_frase.svg"
          style={{
              width: '90%',
              maxWidth: 600,
              display: 'block',
              position: 'relative',
              margin: '60px auto 1%',
              left: '3%',
              right: '3%',

          }}
        />
        <img
        src="/assets/images/hero_banner.svg"  
          style={{
              width: '100%',
              maxWidth: 960,
              display: 'block',
              margin: '0 auto 5%'
          }}
        />

        <h2>RECENTES NO BLOG</h2>
        <h5>Informações do mundo da tecnologia, cursos e dicas para desenvolvedores e empresários</h5>

      </Container>
    </>
  );
}
